import React from "react";
import { Table } from "react-bootstrap";
import CategorySubPage from "../components/CategorySubPage";

const WebExploitationChallenges = () => {
  const challengesContent = (
    <Table bordered hover>
      <thead>
        <tr>
          <th>Challenge Name</th>
          <th>Difficulty</th>
          <th>Points</th>
          <th>Completed</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>SQL Injection 101</td>
          <td>Easy</td>
          <td>100</td>
          <td>Yes</td>
        </tr>
        <tr>
          <td>XSS Adventure</td>
          <td>Medium</td>
          <td>200</td>
          <td>Yes</td>
        </tr>
        {/* Add more challenges as needed */}
      </tbody>
    </Table>
  );

  return (
    <CategorySubPage
      title="Web Exploitation Challenges"
      content={challengesContent}
      buttons={[
        {
          text: "Back to Overview",
          path: "/web-exploitation",
          variant: "secondary",
        },
      ]}
    />
  );
};

export default WebExploitationChallenges;
